function Table(props){
    let thub = props.thumbnail
    let source = "/imag/" + thub
    return (
        <table>
            <tr id={props.ID} >
                <td >{props.ID}</td> 
                <td><img src={source} alt=""/></td>
                <td  onDoubleClick={props.update(this, 'FirstName', '{props.ID}', '{props.FirstName}')}>{props.FirstName }</td>
                <td  onDoubleClick={props.update(this, 'LastName', '{props.ID}', '{props.LastName}')}>{props.LastName }</td>
                <td  onDoubleClick={props.update(this, 'height', '{props.ID}', '{props.height}')}>{props.height}</td>

                <td>
                    <button onClick={() => props.deleteMe(props.id)} >ðŸ—‘</button>
                </td>
            </tr>
        </table>

    )
}

export default Table;
